package scaler.module1.arrays.prefixsum;

import java.util.Arrays;

public class AQ4RangeSumQuery {
  //  Problem Description
  //  You are given an integer array A of length N.
  //  You are also given a 2D integer array B with dimensions M x 2, where each row denotes a [L, R]
  // query.
  //  For each query, you have to find the sum of all elements from L to R indices in A (1 -
  // indexed).
  //  More formally, find A[L] + A[L + 1] + A[L + 2] +... + A[R - 1] + A[R] for each query.
  //  Problem Constraints
  // 1 <= N, M <= 105
  //      1 <= A[i] <= 109
  //      1 <= L <= R <= N
  //  Input Format
  //  The first argument is the integer array A.
  //  The second argument is the 2D integer array B.
  //      Output Format
  //  Return an integer array of length M where ith element is the answer for ith query in B.
  //  Example Input
  //  Input 1:
  //  A = [1, 2, 3, 4, 5]
  //  B = [[1, 4], [2, 3]]
  //  Input 2:
  //  A = [2, 2, 2]
  //  B = [[1, 1], [2, 3]]
  //  Example Output
  //  Output 1:
  //      [10, 5]
  //  Output 2:
  //      [2, 4]
  //  Example Explanation
  //  Explanation 1:
  //  The sum of all elements of A[1 ... 4] = 1 + 2 + 3 + 4 = 10.
  //  The sum of all elements of A[2 ... 3] = 2 + 3 = 5.
  //  Explanation 2:
  //  The sum of all elements of A[1 ... 1] = 2 = 2.
  //  The sum of all elements of A[2 ... 3] = 2 + 2 = 4.
  public static void main(String[] args) {

    int[] input1A = {1, 2, 3, 4, 5};
    int[][] input1B = {{1, 4}, {2, 3}};
    System.out.println(
        Arrays.toString(new AQ4RangeSumQuery().rangeSum(input1A, input1B))); // [10, 5]

    int[] input2A = {2, 2, 2};
    int[][] input2B = {{1, 1}, {2, 3}};
    System.out.println(
        Arrays.toString(new AQ4RangeSumQuery().rangeSum(input2A, input2B))); // [2, 4]
    int[] input3A = {7, 3, 1, 5, 5, 5, 1, 2, 4, 5};
    int[][] input3B = {
      {7, 10},
      {3, 10},
      {3, 5},
      {1, 10}
    };
    System.out.println(
        Arrays.toString(new AQ4RangeSumQuery().rangeSum(input3A, input3B))); // output 12 28 11 38
  }

  public long[] rangeSum(int[] A, int[][] B) {
    return sol2(A, B);
    //        return sol1(A, B);
  }

  private long[] sol2(int[] A, int[][] B) {
    long[] ans = new long[B.length];

    long[] pfSumArr = new long[A.length];
    pfSumArr[0] = A[0];
    for (int i = 1; i < A.length; i++) {
      pfSumArr[i] = pfSumArr[i - 1] + A[i];
    }
    //    System.out.println("Original Array : " + Arrays.toString(A));
    //    System.out.println("PF sum : " + Arrays.toString(pfSumArr));
    for (int i = 0; i < B.length; i++) {
      int start = B[i][0] - 2;
      int end = B[i][1] - 1;
      if (start < 0) {
        ans[i] = pfSumArr[end];
      } else ans[i] = pfSumArr[end] - pfSumArr[start];
    }
    return ans;
  }

  private long[] sol1(int[] A, int[][] B) {
    long[] ans = new long[B.length];
    System.out.println(B.length);
    for (int i = 0; i < B.length; i++) {
      long sum = 0;
      for (int k = B[i][0] - 1; k < B[i][1]; k++) {
        sum = sum + A[k];
      }
      ans[i] = sum;
    }
    System.out.println(Arrays.toString(ans));
    return ans;
  }
}


